class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $k
     * @return Integer
     */
    function minOperations($nums, $k) {
        $operations = 0; // Initialize counter for operations
        $collected = array_fill(1, $k, false); // Initialize collected elements tracker
        $collectedCount = 0; // Count of unique elements collected from 1 to k

        // Loop from the end until all elements from 1 to k are collected
        for ($i = count($nums) - 1; $i >= 0 && $collectedCount < $k; $i--) {
            $operations++; // Increment operation count
            // Check if the element is within 1 to k and not already collected
            if ($nums[$i] <= $k && !$collected[$nums[$i]]) {
                $collected[$nums[$i]] = true; // Mark as collected
                $collectedCount++; // Increment collected unique elements count
            }
        }

        return $operations; // Return the minimum number of operations needed
    }
}
